import { openDB } from './db.js';

// dataWorker.js
self.addEventListener('message', async (e) => {
  console.log('fetching data...', e.data);
  const db = await openDB();
  const transaction = db.transaction(['data'], 'readwrite');
  const store = transaction.objectStore('data');


  fetch('https://reqres.in/api/users?page=2')
    .then(response => response.json())
    .then(data => {
      // Add a timestamp to the data
      const timestampedData = {
        id: 1, // We'll use a fixed ID for simplicity
        data,
        timestamp: Date.now()
      };


      // Store the data in IndexedDB
      const request = store.delete()
      // const request = store.put(timestampedData);

      request.onsuccess = () => {
        // Send the data back to the main thread
        self.postMessage(timestampedData);
      };


      self.postMessage(timestampedData);
    });

   // Close the database connection after the transaction has completed
  transaction.oncomplete = () => {
    db.close();
  };
});
